import { TodoStatus } from "../types/status"
import { ITodo } from "../types/todo"

export const getFilteredTodos = (todos: ITodo[], filterType: TodoStatus) => {
    switch (filterType) {
        case TodoStatus.COMPLETED:
            return todos.filter((todo) => todo.status === TodoStatus.COMPLETED)
        case TodoStatus.NOT_COMPLETED:
            return todos.filter((todo) => todo.status === TodoStatus.NOT_COMPLETED)
        default:
            return todos
    }
}
